import "./Exam.css";
const Exam = () => {
  const readMore=()=>{
    window.location.href="http://localhost:3000/school/1"
  }
  return (
    <>
      <div className="searchItem">
        <img
          src="https://cdn.siasat.com/wp-content/uploads/2021/06/eamcet.jpg"
          alt=""
          className="siImg"
        />
        <div className="siDesc">
          <h1 className="siTitle">TS-Eamcet</h1>
          <span className="siDistance"></span>
          <span className="siTaxiOp">State Board</span>
          <span className="siFeatures">NAAC A+ • Hostel • NCC</span>
        </div>
        <div className="siDetails">
          <div className="siRating">
            <button>8.9</button>
          </div>
          <div className="siDetailTexts">
            <button className="siCheckButton" onClick={readMore}>See More</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default Exam;
